            <h1>{props.email}</h1>
        </div>
    );
};




























const Job = (props) => {
    return(
        <div>
            <p>{props.salary}</p>;
            <p>{props.position}</p>;
            <p>{props.company}</p>;
        </div>
    );
};
export default App;
